pub(super) fn lookup(ch: char) -> &'static [char] {
    let cp = ch as u32;
    CODEPAGE_RANGES
        .binary_search_by(|&(start, end, _)| {
            if cp < start {
                std::cmp::Ordering::Greater
            } else if cp > end {
                std::cmp::Ordering::Less
            } else {
                std::cmp::Ordering::Equal
            }
        })
        .map(|idx| CODEPAGE_MARKER_SETS[CODEPAGE_RANGES[idx].2])
        .unwrap_or_default()
}
